package leetcode.solutions;

import java.util.ArrayList;
import java.util.Arrays;
import java.util.HashMap;
import java.util.Iterator;
import java.util.List;
import java.util.Map;

/**
 * Sorting a String by the frequency of Characters
 * 
 * @author flipswitch
 *
 */
public class SortCharacterByFrequency {

	/**
	 * Test Calls
	 * 
	 * @param args
	 */
	public static void main(String[] args) {

		System.out.println(frequencySort("Aabb"));
		System.out.println(frequencySort("tree"));
		System.out.println(frequencySort("cccaaa"));
		System.out.println(frequencySort(""));
		System.out.println(frequencySort(""));

	}

	/**
	 * Sorting based on frequency of Characters
	 * 
	 * @param s
	 * @return
	 */
	public static String frequencySort(String s) {

		// If String is empty or a single character, that is the answer itself
		if (s.length() == 0 || s.length() == 1 || s.isEmpty())
			return s;
		int max = Integer.MIN_VALUE;

		Map<Character, Integer> map = new HashMap<>();

		// Record frequency of each character and store it in a map.
		for (int i = 0; i < s.length(); i++) {
			if (map.containsKey(s.charAt(i))) {
				// If key exists
				map.put(s.charAt(i), map.get(s.charAt(i)) + 1);
			} else {
				// If key does not exists, create one.
				map.put(s.charAt(i), 1);
			}

			// Get Maximum.
			if (map.get(s.charAt(i)) > max)
				max = map.get(s.charAt(i));
		}
		
		// Create a reference list for each frequency
		// and store the respective characters having that particular
		// Frequency
		List<Character>[] bucket = new List[max + 1];
		for (char key : map.keySet()) {
			if (bucket[map.get(key)] == null) {
				bucket[map.get(key)] = new ArrayList<>();
			}
			
			bucket[map.get(key)].add(key);
		}
		
		
		StringBuilder output = new StringBuilder();
		
		//Go through each bucket from the end and combine the output
		for (int i = bucket.length - 1; i >= 0; i--) {
			
			List<Character> list = bucket[i];
			
			// If the particular frequency has any characters
			if (list != null) {
				
				// Iterate through them and build the output
				// By multiplying the characters with the frequency
				Iterator<Character> iter = list.iterator();
				while (iter.hasNext()) {
					char c = iter.next();
					char[] charArray = new char[i];
					Arrays.fill(charArray, c);
					output.append(new String(charArray));
				}
			}
		}
		
		return output.toString();
	}
}
